import React from 'react';
import data from './data/scores.json'

function JsonProcessor() {
    for(var i = 0; i < data.length; i++){
      var name = data[i];
      if(name.submissions.length > 3) { // We've got to rule out submissions less than 3.
        //console.log(name.name + " " + name.submissions.length);
        if(name.submissions.length > 23) {
          console.log(name.name + " " + name.submissions.length);
        }
      }
    }
  return (
    <div>...</div>
  );
}


export default JsonProcessor;
